import React, { Component } from 'react';
import axios from "axios";
import Popup from "reactjs-popup";

class Newpassword extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            newpassword : '',
            confirmpassword : ''
        }
    }
    render() { 
        return ( <Popup open={true} position="right center">
        <center>
            <input type="password" value={this.state.newpassword} onChange={e=>{this.setState({phone : e.target.value})}} placeholder="Enter Email or Phone" required/>
            <br/><br/>
            <input type="password" value={this.state.c} onChange={e=>{this.setState({user_otp : e.target.value})}} placeholder="Enter The OTP Received" required/>
            <br/><br/>
        </center>
      </Popup> );
    }
}

export default Newpassword;
